import fetch from "isomorphic-unfetch";

export const getProposalContent = (gitlabProjectId, refName = "master") => {
  return fetch(
    `${process.env.GITLAB_BASE_URL}/projects/${gitlabProjectId}/repository/files/content%2Emd/raw?ref=${refName}`
  );
};
